import Header from '../Header';

import Container from 'react-bootstrap/Container';

const Hobbies = () => {
  return (
    <div>
        <Container>
            <Header/>
            <div className="custom">Under construction. Come back soon!</div>
        </Container>
    </div>
  )
}

export default Hobbies
